"use strict";
class Mobile {
    constructor(burstMode, cameraMode, filter) {
        this.burstMode = burstMode;
        this.cameraMode = cameraMode;
        this.filter = filter;
    }
}
class Yt {
    constructor(burstMode, cameraMode, filter, shorts, // can add more properties,
    createStory) {
        this.burstMode = burstMode;
        this.cameraMode = cameraMode;
        this.filter = filter;
        this.shorts = shorts;
        this.createStory = createStory;
    }
}
